exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper}=await require("transcode/parse_catalog");return parseCatalog(`http://www.ibiquw.com/book/${bid}/`,{cleaner:html=>cleanCatalogWrapper(html,/class="book_list"[^>]*>/,"</ul>"),recordRegex:/href="(?<url>[^"]+)">(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions)}})};